import React from 'react';
import './Nav.css';

function Nav() {
    return (
        <div className="nav">
            <img className="nav__logo"
             src="https://assets.brand.microsites.netflix.io/assets/1ed15bca-b389-11e7-9274-06c476b5c346_cm_800w.png?v=24"
            alt="Netflix Logo"
            />

            
        </div>
    )
}

export default Nav
